			shellScript = "#xcodebuild -project ***.xcodeproj -target FrameworkMaker_Release;rm -rf build;\nproductName=\"${PROJECT_NAME}\"\ntarget=\"${productName}\"\ntmpDir=\"${PROJECT_TEMP_DIR}/build\"\nuseTargetName=\"XYSDKDebug\" #测试XYSDK的工程，如果修改工程的话，直接修改这里\nrm -rf \"${tmpDir}\"#清除编译临时文件\n\n#编译bundle\nxcodebuild -target \"${PROJECT_NAME}Bundle\" -configuration \"Release\" -sdk \"iphoneos\" build SYMROOT=\"${tmpDir}\" ONLY_ACTIVE_ARCH=\"NO\" VALID_ARCHS=\"arm64 armv7 armv7s i386 x86_64\"\n\nfunction buildLibs(){\n    sdks=(\"iphonesimulator\" \"iphoneos\")\n    configurations=(\"Debug\" \"Release\")\n    for configuration in ${configurations[@]}\n    do\n    for sdk in ${sdks[@]}\n    do\n    xcodebuild -target \"${target}\" -configuration \"${configuration}\" -sdk \"${sdk}\" build SYMROOT=\"${tmpDir}\" ONLY_ACTIVE_ARCH=\"NO\" VALID_ARCHS=\"arm64 armv7 armv7s i386 x86_64\"\n    done\n    done\n}\nfunction lipoLibs(){\n    #copy Release-iphoneos到 Frameworks 目录,然后 lipo -c 一份\n    ios_xy_sdks_dir=\"${SRCROOT}/../${useTargetName}/ios_xy_sdk\"\n    frameworkDir=\"${ios_xy_sdks_dir}/Frameworks\"\n    [ -d \"${frameworkDir}\" ] || mkdir -p \"${frameworkDir}\"\n    cp -r \"${ios_xy_sdks_dir}/Release-iphoneos/${productName}.framework\" \"${frameworkDir}/\"\n    #lipo -c ... -o ..\n    lipo -c \"${ios_xy_sdks_dir}/Release-iphoneos/${productName}.framework/${productName}\" \"${ios_xy_sdks_dir}/Release-iphonesimulator/${productName}.framework/${productName}\" -o \"${frameworkDir}/${productName}.framework/${productName}\"\n    rm -rf \"${frameworkDir}/${productName}.framework/_CodeSignature\"\n}\nfunction rmReleaseLibs(){\n    ios_xy_sdks_dir=\"${SRCROOT}/../${useTargetName}/ios_xy_sdk\"\n    sdks=(\"iphonesimulator\" \"iphoneos\")\n    configurations=(\"Release\")\n    for configuration in ${configurations[@]}\n    do\n    for sdk in ${sdks[@]}\n    do\n    rm -rf \"${ios_xy_sdks_dir}/${configuration}-${sdk}/${productName}.framework\"\n    done\n    done\n}\nfunction rmDebugLibs(){\n    ios_xy_sdks_dir=\"${SRCROOT}/../${useTargetName}/ios_xy_sdk\"\n    sdks=(\"iphonesimulator\" \"iphoneos\")\n    configurations=(\"Debug\")\n    for configuration in ${configurations[@]}\n    do\n    for sdk in ${sdks[@]}\n    do\n    rm -rf \"${ios_xy_sdks_dir}/${configuration}-${sdk}/${productName}.framework\"\n    done\n    done\n}\nfunction rmFrameworkLibs(){\n    ios_xy_sdks_dir=\"${SRCROOT}/../${useTargetName}/ios_xy_sdk\"\n    configurations=(\"Frameworks\")\n    rm -rf \"${ios_xy_sdks_dir}/${configuration}/${productName}.framework\"\n}\nrmFrameworkLibs\nrmReleaseLibs\nrmDebugLibs\nbuildLibs\nlipoLibs\n#cp to IOS_XYSDK\n#cp -Rf \"${SRCROOT}/IOS_XYSDK/Frameworks/${productName}.framework\" \"${SRCROOT}/../IOS_XYSDK/Frameworks/${productName}.framework\"";
